% Calculate the coefficients when expanding the Fourier series
function [a0, an, bn] = getFourierSeriesExpansionConstants(x, t, N, w0, T)
    a0 = (2/T)*trapz(t,x);
    an = zeros(N,1);
    bn = zeros(N,1);
    for n=1:N
        an(n) = (2/T)*trapz(t,x.*cos(n*w0*t));
        bn(n) = (2/T)*trapz(t,x.*sin(n*w0*t));
    end
end

function str = getFourierSeriesExpansionText(a0, an, bn, w0)
    N = length(an);
    str = sprintf('x = %g/2', a0);
    for n=1:N
        str = sprintf('%s + %g*cos(%d*%g*t) + %g*sin(%d*%g*t)', str, an(n), n, w0, bn(n), n, w0);
    end
end


